import { useEffect, useState } from 'react';
import './App.css';

function App() {
  const [data, setData] = useState([])

  useEffect(() => {
    fetchData()
  }, [])

  const fetchData = async () => {
    const res = await fetch("http://localhost:8000/todos/")
      .then(response => response && response.json())
      .then(res => res && setData(res))
  }

  return (
    <div className="App">
      {data?.map(text =>
        <div>
          <li> {text.text}</li>
        </div>)
      }
    </div>
  );
}

export default App;
